import React from 'react';
// import './Button.css'
import { Container, Row, Col } from 'react-bootstrap';

const Button = ({num}) => {
  return (
    <Container>
      <Row className="justify-content-center">
        <Col xs={10} lg={6} className="mt-4 rounded rollCard">
            <Row className="py-3">
            <Col xs={3}>{num}</Col>
            <Col xs={9}>{text}</Col>
            </Row>
        </Col>
      </Row>
    </Container>
  );
}

export default Button;
